import React, { Component } from 'react';
import "./App.css";
import Navbar from './navbar';

class App extends Component{
  render(){
    return (
      <React.Fragment>
        <Navbar />
        <h1>Hello</h1>
      </React.Fragment>
    );
  };
}

export default App;
